import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return(
    <header>
      <ul>
        <li><Link to="/dashboard"> Dashboard </Link></li>
        <li><Link to="/manage"> Manage </Link></li>
      </ul>
    </header>
  )
}

export default Header;
